import Navbar from "../../Components/navbar/Navbar";
import Header from "../../Components/header/Header";
import Slider from "../../Components/slider/Slider";

export default function Home() {
    let props = {
        // LeftArrow || noAction
        action: "noAction",
        subheader: "active",
        text: "World's News"
    }

    return (
        <div>
            <Header action = {props.action} text = {props.text} subheader = {props.subheader} />
            <Slider />
            <Header action={props.action} text={props.text}/>
            <Navbar />
        </div>
    )
}
